import css from 'styles.module.css'
import { ImageGalleryItem } from '../ImageGalleryItem/ImageGalleryItem';
import { nanoid } from 'nanoid'
// model.id = nanoid() //=> "V1StGXR8_Z5jdHi6B-myT"


axios.defaults.baseURL = `https://pixabay.com/api/?q=cat&page=1&key=30662426-21982097d0559eebc608a0eec&`;
const GalleryList = ({ pictures }) => (
  <ul>
    {pictures.map(({ id, pageUrl, tags }) => (
      <li key={id}>
        <a href={pageUrl} target="_blank" rel="noreferrer noopener">
          {tags}
        </a>
      </li>
    ))}
  </ul>
);


export const ImageGallery = () => {
    return <ul className={css.ImageGallery}>
        <ImageGalleryItem key={nanoid()}/>
    </ul>;
};
